import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  Grid, 
  Card, 
  CardContent, 
  Typography, 
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  Box
} from '@mui/material';
import API from '../services/api';
import Cart from './Cart';
import SuccessModal from './SuccessModal';

function ProductList() {
  const [products, setProducts] = useState([]);
  const [cartItems, setCartItems] = useState([]);
  const [showSuccessModal, setShowSuccessModal] = useState(false);
  const [selectedProduct, setSelectedProduct] = useState(null);
  const [priceDialogOpen, setPriceDialogOpen] = useState(false);
  const [price, setPrice] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await API.get('/api/products?populate=*');
        const correctedProducts = response.data.data.map(product => ({
          ...product,
          id: product.id
        }));
        setProducts(correctedProducts);
      } catch (error) {
        console.error('Error fetching products:', error);
      }
    };

    fetchProducts();
  }, []);

  const addToCart = (product, price) => {
    setCartItems([...cartItems, { product, price }]);
  };

  const removeFromCart = (index) => {
    setCartItems(cartItems.filter((_, i) => i !== index));
  };

  const handleCheckout = async () => {
    try {
      for (const item of cartItems) {
        const saleData = {
          Price: parseFloat(item.price),
          Time: new Date().toISOString(),
          store: parseInt(localStorage.getItem('storeId')),
          product: item.product.id
        };

        await API.post('/api/sales/create-with-relation', {
          data: saleData
        });
      }

      setCartItems([]);
      navigate('/sales');
    } catch (error) {
      console.error('Checkout error:', error);
    }
  };

  const handleProductClick = (product) => {
    setSelectedProduct(product);
    setPriceDialogOpen(true);
  };

  const handlePriceSubmit = () => {
    if (selectedProduct && price) {
      addToCart(selectedProduct, price);
      setPriceDialogOpen(false);
      setPrice('');
    }
  };

  return (
    <Box sx={{ display: 'flex', height: '100vh' }}>
      {/* Products Section - Left 50% */}
      <Box sx={{ width: '50%', p: 3, overflowY: 'auto' }}>
        <Grid container spacing={3}>
          {products.map((product) => (
            <Grid item xs={12} sm={6} key={product.id}>
              <Card 
                onClick={() => handleProductClick(product)}
                sx={{ 
                  cursor: 'pointer',
                  '&:hover': { boxShadow: 3 }
                }}
              >
                <CardContent>
                  <Typography variant="h6">
                    {product.Product}
                  </Typography>
                  <Typography color="textSecondary">
                    Click to add to cart
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* Cart Section - Right 50% */}
      <Box sx={{ width: '50%', height: '100%' }}>
        <Cart 
          items={cartItems} 
          removeFromCart={removeFromCart}
          checkout={handleCheckout}
        />
      </Box>

      {/* Price Dialog */}
      <Dialog 
        open={priceDialogOpen} 
        onClose={() => setPriceDialogOpen(false)}
      >
        <DialogTitle>
          Set Price for {selectedProduct?.Product}
        </DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Price"
            type="number"
            fullWidth
            value={price}
            onChange={(e) => setPrice(e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setPriceDialogOpen(false)}>
            Cancel
          </Button>
          <Button 
            onClick={handlePriceSubmit}
            variant="contained" 
            color="primary"
            disabled={!price}
          >
            Add to Cart
          </Button>
        </DialogActions>
      </Dialog>

      {/* Success Modal */}
      {showSuccessModal && (
        <SuccessModal
          items={cartItems}
          total={cartItems.reduce((sum, item) => sum + parseFloat(item.price), 0)}
          onClose={() => {
            setShowSuccessModal(false);
            setCartItems([]);
          }}
        />
      )}
    </Box>
  );
}

export default ProductList;
